import "./LinkButton.css";



class LinkButton extends Component {
    render() {
        return (
            <>
                <a href={this.props.onClick}>
                    <span id={this.props.spanId} className='semibold'>
                        {this.props.text}
                    </span>
                </a>
                {/* <a
                    variant='Link'
                    className='linkButton'
